import React from "react";

export const Contact = () => {
  return (
    <div className="contact-bg my-20">
      <div className="flex items-center">
        <h1 className="relative top-32 text-6xl font-extrabold px-20">
          Let's work together
        </h1>
        <button className="button relative top-32 left-72 py-3 px-5 rounded-3xl text-xl">
          Email
        </button>
      </div>
    </div>
  );
};
